import React from "react";
import { Box, Grid, FilledInput, Select, MenuItem, Dialo, DialogTitle, DialogContent, DialogActions } from '@material-ui/core';

export default props => {

    return (
        <Dialog>
            <DialogTitle>Post Job</DialogTitle>
            <DialogContent>
                <Grid container>
                    <Grid item xs={6}>
                        <FilledInput placeholder="Job title *" disableUnderline/>
                    </Grid>
                </Grid>
            </DialogContent>
        </Dialog>
    )
}
